class Solution {
    /**
     * @param {ListNode} head
     * @return {number}
     */

    encode(strs) {
        let encoded = ''
        for (let word of strs) {
            let len = word.length
            encoded += len + '#' + word
        }
        return encoded
    }

    /**
     * @param {string} str
     * @returns {string[]}
     */
    decode(str) {
        const result = []

        let i = 0
        while (i < str.length) {
            let j = i
            while (str[j] !== '#') {
                j++
            }

            let len = parseInt( str.substring(i, j) )
            let word = str.substring(j + 1, j + 1 + len)
            result.push(word)
            i = j + 1 + len
        }
        return result
    }

}

/**
 * Definition for singly-linked list.
 * class ListNode {
 *     constructor(val = 0, next = null) {
 *         this.value = val;
 *         this.next = next;
 *     }
 * }
 */


class Solution {
    /**
     * @param {ListNode} head
     * @return {number}
     */

    encode(strs) {
        let encoded = '';
        for (let word of strs) {
            let length = word.length
            encoded += length + "#" + word
        }
        return encoded
    }

    /**
     * @param {string} str
     * @returns {string[]}
     */
    decode(encoded) {
        const result = []
        for (let i = 0; i < encoded.length; i++) {
            let j = i
            while (encoded[j] !== '#') {
                j++
            }

            let length = parseInt(encoded.substring(i, j))
            let word = encoded.substring(j + 1, j + 1 + length)
            result.push(word)
            i = j + length
        }
        return result

    }

}

