class Solution {
    /**
     * @param {string[]} strs
     * @return {string[][]}
     */
    groupAnagrams(strs) {

        const map = {}
        for (let word of strs) {
            let freq = Array(26).fill(0)
            for (let c of word) {
                let code = c.charCodeAt(0) - 'a'.charCodeAt(0)
                freq[code] += 1
            }

            let key = freq.join()
            if (! (key in map)) map[key] = []
            map[key].push(word)
        }

        return Object.values(map)
    }
}

