class Solution {
    /**
     * @param {number[]} arr
     * @param {number} target
     * @return {number} index
     */
    search(arr, target) {

        let l = 0
        let r = arr.length-1

        while(l <= r) {
            let mid = Math.floor( (l + r) / 2)
            if (arr[mid] === target) return mid
            if (arr[mid] < target) l = mid + 1
            if (arr[mid] > target) r = mid - 1
        }
        return -1
    }
}

